import {Component} from "react";

class Button extends Component {
    render() {
        let buttonType = () => this.props.buttonType === 'primary'? 'bg-yellow-500 hover:bg-yellow-600' : 'bg-yellow-950 hover:bg-yellow-900'
        return (
            <button className={`${buttonType()} p-2 text-4xl py-2 font-bold px-4 border border-sky-600 rounded`}>
                {this.props.buttonLabel}
            </button>
        );
    }
}

export default Button
